import React, { useEffect, useState } from 'react';
import ProjectList from '../components/ProjectList';
import { getProjects } from '../api/projectApi';

const Home = () => {
  const [projects, setProjects] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    let mounted = true;
    getProjects()
      .then((data) => { if (mounted) setProjects(data); })
      .catch((e) => setError(e?.response?.data?.message || 'Failed to load projects'))
      .finally(() => setIsLoading(false));
    return () => { mounted = false; };
  }, []);

  return (
    <div>
      <section className="mb-8">
        <h1 className="text-3xl font-bold">Featured Architecture Projects</h1>
        <p className="text-gray-600 mt-1">A curated portfolio of spaces and structures.</p>
      </section>
      <ProjectList projects={projects} isLoading={isLoading} error={error} />
    </div>
  );
};

export default Home;
